import React from "react";

const Header = () => {
  return (
    <React.Fragment>
     <nav>
       <a href="#home"><i class='bx bxs-home'></i></a>
       <a href="#about"></a>
       <a href="#resume"></a>
       <a href="#portfolio"></a>
       <a href="#contact"></a>
     </nav>
    </React.Fragment>
  );
};
export default Header;
